import React from 'react';
import 'bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';


const TambahUser = () => {
  return (
    <div>
      {/* form  */}
      <div className='container'>
        {/* nama */}
      <div class="input-group mb-3">
        <span class="input-group-text" id="basic-addon1">@</span>
        <input type="text" className="form-control" placeholder="Nama lengkap" aria-label="Username" aria-describedby="basic-addon1"/>
      </div>
      {/* ./nama */}
      {/* email */}
      <div class="mb-3">
        <label for="exampleFormControlInput1" className="form-label">Email address</label>
        <input type="email" className="form-control" id="exampleFormControlInput1" placeholder="nama@gmail.com" />
      </div>
      {/* ./email */}
      {/* gender */}
      <label for="GenderDataList" className="form-label">Jenis Kelamin</label>
        <input className="form-control" list="datalistGender" id="GenderDataList" placeholder="gender" />
        <datalist id="datalistGender">
          <option value="San Francisco"/>
          <option value="New York"/>
        </datalist>
      {/* ./gender */}
      {/* gender */}
      <label for="JurusanDataList" className="form-label">Jenis Kelamin</label>
        <input className="form-control" list="datalistJurusan" id="JurusanDataList" placeholder="gender" />
        <datalist id="JurusanGender">
          <option value="Informatika A"/>
          <option value="Informatika B"/>
          <option value="Informatika C"/>
          <option value="Informatika D"/>
          <option value="Informatika E"/>
          <option value="Informatika F"/>
        </datalist>
      {/* ./gender */}
      </div>
      {/* ./form */}
    </div>
  )
}

export default TambahUser;
